(1, 'Кузов, магазин', 'europroject.ru', 'a_kuzov@bk.ru', NULL, '', 'Европроект Групп, авторемонт, промышленная окраска, абразивная обработка, ЭКСКЛЮЗИВНОСТЬ, КОМПЛЕКСНОСТЬ, ДОСТУПНОСТЬ, европроект', 'Направление компании Европроект Групп – это авторемонт, промышленная окраска, абразивная обработка, а так же ЭКСКЛЮЗИВНОСТЬ, КОМПЛЕКСНОСТЬ, ДОСТУПНОСТЬ.', NULL, 3, '1', '801be56b85c709418a3641e63076406d', 0, 0, NULL, '2018-10-05 03:56:08', 0, '2018-10-05 00:56:08', '2018-10-05 00:56:08'),
(2, 'КиК, фирменный магазин', 'kolesa-kik.ru', 'abakan.kik@mail.ru', NULL, '', 'Колеса, колесные диски, производство колесных дисков, продажа колесных дисков, производство колес, продажа колес, диски официальный сайт, колеса КиК, колеса K&K,', 'ООО &quot;КиК&quot; крупнейший производитель колес в России. Колесные диски  K&K  - это новые технологии производства и высоки стандарты качества.  На нашем официальном сайте Вы найдете не только информацию о ценах и размерах дисков, но и полезные советы.  Интересы компании далеко не ограничиваются производством и продажей колес. Поэтому здесь представлена информация о партнерских программах компании КиК, инновационных исследованиях и экологических аспектах. Продажа колес K&K осуществляется по всей России. Наши представители есть в Москве, СПб, Екатеринбурге, Уфе, Челябинске, Казани, Самаре, Краснодаре и многих других городах. Колесные диски K&K – безопасность, созданная в России.', NULL, 3, '1', '195f7ebd62c1ae0a02005036b604ea7f', 0, 0, NULL, '2018-10-05 03:56:08', 0, '2018-10-05 00:56:08', '2018-10-05 00:56:08'),
