(153, 'Лик, ООО, торговая компания', 'xn--24-vlcid.xn--p1ai', '355164@mail.ru', NULL, '', '', 'Недавно удалось покататься на сигвее, точнее на его мини-версии. Мини-сигвей Ninebot Mini отличается от обычного сигвея тем, что имеет куда более компактный вид. Другое название мини-сигвея — гироскутер. Гироскутер или мини-сигвей позиционируется как средство передвижения, но на данный момент это средство развлечения. В  основном  этому  способствует тот факт, что мини-сигвей представляет собой компактную платформу, которой можно управлять с помощью тела. Большинство людей думает, что это нечто вроде скейта, или роликовых коньков. Но это скорее странный электромопед. Сигвей поднимается даже в горку под небольшим уклоном. В движении сигвей практически бесшумен, движение плавное, как по маслу. Если Ninebot Mini не используется несколько секунд, то с целью экономии заряда батареи, устройство автоматически выключается.', NULL, 3, '1', '2f592abc65cf2be71e80a9bc22193390', 0, 0, NULL, '2018-10-05 04:08:52', 0, '2018-10-05 01:08:52', '2018-10-05 01:08:52'),
